import "./App.css";
import { Routes, Route, BrowserRouter } from "react-router-dom";
// import Sidenavbar from "./components/Sidenavbar/Sidenavbar";
import Sidenavbar from "./components/Sidenavbar/Sidenavbar";
import { NavbarContext } from "./context/Navabr/NavbarContext";

const App = () => {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/sidenavbar" 
          element={
            <NavbarContext.Provider value={ useNavbarContext()}>
          <Sidenavbar />
          </NavbarContext.Provider>

        } />
          {/* <Route path="/about" element={<About />} /> */}
          {/* <Route path="/contact" element={<Contact />} /> */}
        </Routes>
      </BrowserRouter>
    </div>
  );
};

export default App;
